import React from "react";
import "./style.scss";

function TreeItem() {
	return (
		<ul className="tree">
			{/* <!-- (A) "NORMAL" ITEMS --> */}
			<li>Item A</li>
			<li>Item B</li>

			{/* <!-- (B) SECTION --> */}
			<li className="section">
				<input type="checkbox" id="groupA" />
				<label htmlFor="groupA">Group A</label>
				<ul>
					<li>Group A Item 1</li>
					<li>Group A Item 2</li>
				</ul>
			</li>

			{/* <!-- (C) SECTION WITH SUB-SECTION --> */}
			<li className="section">
				<input type="checkbox" id="groupB" />
				<label htmlFor="groupB">Group B</label>
				<ul>
					<li>Group B Item 1</li>
					<li>Group B Item 2</li>
					{/* <!-- SUB-SECTION --> */}
					<li className="section">
						<input type="checkbox" id="groupC" />
						<label htmlFor="groupC">Group C</label>
						<ul>
							<li>Group C Item 1</li>
							<li>Group C Item 2</li>
						</ul>
					</li>
				</ul>
			</li>
		</ul>
	);
}

export default TreeItem;
